import React, { useState } from "react"

let btnNotClicked = false
// let mylabel = "not clicked"
const Table = props => {
  // const [show, setShow] = useState(false)
  const [buttonText, setButtonText] = useState("Not Arrived ")
  const [color, setColor] = useState("red")
  // const [bookingList, setBookingList] = useState([])

  // setBookingList(bookingList.concat(props.values))

  const clickHandle = () => {
    // alert("kuku")
    btnNotClicked = true
    // console.log("wer")
    // mylabel = "clicked"
  }

  return (
    <div>
      <h3>Booking List</h3>

      <table>
        <thead>
          <tr>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email</th>
            <th>Tel Number</th>
            <th>Cover</th>
            <th>Date</th>
            <th>Time</th>
            <th>Booked</th>
          </tr>
        </thead>

        <tbody>
          {props.bookingList.map(value => {
            return (
              <tr className="rows">
                <td>{value.firstName}</td>
                <td>{value.lastName}</td>
                <td>{value.email}</td>
                <td>{value.telNumber}</td>
                <td>{value.cover}</td>
                <td>{value.date}</td>
                <td>{value.time}</td>

                <td>
                  <button
                    style={{ color: color }}
                    onClick={() => {
                      setButtonText("seated")
                      setColor("green")
                    }}
                  >
                    {buttonText}
                  </button>
                </td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
